    return (
        <div>
            <div style={{ display: "flex", flexDirection: "column", alignItems: "end", width: '274px' }}>
                <MyInput2
                    title={"Собитие"}
                    value={nam}
                    onChange={e => { setNam(e.target.value); console.log(nam); }}
                />
                <MyInput2
                    title={"Название"}
                    value={title}
                    onChange={e => { setTitle(e.target.value); console.log(nam); }}
                />
                <MyInput2
                    title={"Описание"}
                    value={main}
                    onChange={e => { setMain(e.target.value); console.log(nam); }}
                />
            </div>
            <MyButton
                onClick={() => {

                }}
            >Добавить</MyButton>
        </div>
    )
}

export default NewNam
